function initialize(){var e={center:{lat:38.869987,lng:-77.090936},zoom:13},o=new google.maps.Map(document.getElementById("map-canvas"),e),n=controller.getplaces();for(i=0;i<n.length;i++){var a=new google.maps.Marker({position:n[i].position,title:n[i].name});a.setMap(o)}}google.maps.event.addDomListener(window,"load",initialize);